import React from 'react'
import {Row, Divider} from 'antd'

interface ContainerProps {
    children: React.ReactNode
}
export const Container: React.FC<ContainerProps> = props => {
    return (
        <>
            <Row justify={"center"} align={"top"}>
                {props.children}
            </Row>
        </>
    )
}
